comment_text:
@Laidback Luke thanks for bringing this topic up and for sharing both of your perspectives on it. It's a topic that often comes up and it was cool to see some well respected artists like yourselves shed some light on it. So looking forward to one day being able to see one of your life changing live sets <3

@Afrojack  I 100% agree with what you had to say. The best sets I've seen are always the ones where the DJ can read the crowd and adjust to the situation at hand. Whether it's through crowd management on the mic or simply uplifting us through a journey of beats, that is always the difference between a good set and an unforgettable experience.  

I have seen you perform at least 5 times in the past 3 years in Japan and Ibiza and not once have I ever felt like I have seen the same show twice. You continually set the bar for live sets with all the hard work and effort you put into your performances. They are always fresh with new stuff to look forward to. Your show alone is always worth traveling internationally for. Much love and respect <3

Lastly, no disrespect to Zedd, whom I also love dearly, but I gotta say that I was so thankful you guys brought that up. The first time I ever saw him in concert (Tokyo 2016), I had goosebumps and it was truly a mind blowing experience. The second time I went to Zoukout Singapore last year for him and it was a good show but it didn't feel as amazing as the first time. 5 months later at EDC Japan, no joke it was literally song for song the same set, same visuals, and it didn't even truly match the smaller built set. As a fan who had to pay $300 for a 2 day event (general admission), I felt disrespected and I was pissed. Still love his music and the beautiful creations he makes, but damn it was shocking to feel and eye opening to see this happen when you see what else is out there with amazing artists like you guys and Martin Garrix, and how much effort you all put into your live sets. 

Thanks again for doing a video on this! Wishing you both all the love, happiness and success in the world. <3
